import React from "react";
import "./heading.css";

function Heading() {
  return (
    <>
      <div id="heading">
        <div id="span1">
        <span id="span1-1">EB</span>
        </div>
        <div id="span2">
          <p id="span2-1">ELITE <br></br>BANARAS</p>
          {/* <p id="span2-2">BANARAS</p> */}
        </div>
      </div>
    </>
  );
}

export default Heading;
